import React, { useEffect } from "react";
import { Table } from "react-bootstrap";
import { Link } from "react-router-dom";
import Staff_Stats_cards from "./DashboardComponents/Staff_Stats_cards";
import { useDispatch, useSelector } from "react-redux";
import "./index.css";
import { dashboardActions } from "../../../../Actions";
import TableDropdownOrganisation from "./Dropdown/TableDropdownOrganisation";

const AllOrganizations = () => {
  const dispatch = useDispatch();
  let stats: any = [];
  stats = useSelector((state: any) => state?.dashboardStats?.all_organisation);
  useEffect(() => {
    const loadDashboardStats = async () => {
      await dispatch(dashboardActions.getAllOrganisation());
    };
    loadDashboardStats();
  }, [dispatch]);
  //console.log(stats);

  return (
    <>
      <div className="contaniner-fluid">
        <div className="row">
          {/* <AdminSidebar staff={true} /> */}
          <div className="dashboard_main_area pb-0 row">
            <Staff_Stats_cards />
            <div className="col-md-11 expand12">
              <div className="row jcenter pt-9">
                <div className="col-md-12 charthome">
                  <div className="col-md-12 charthome">
                    <div className="sidebarUpdate1 text-left">
                      <span>All Organizations </span>
                      <span>
                        {" "}
                        <input
                          type="text"
                          className="search_on1 searchz form-control"
                          placeholder="search"
                        />
                      </span>
                      <span>
                        <div className="row">
                          <select name="filter" className="filter1" id="">
                            <option value="">Filter</option>
                          </select>
                          <Link to={`/admin/organisation/add`}>
                            <button className="addstaff bluebtn">
                              + Add Organization
                            </button>
                          </Link>
                        </div>
                      </span>
                    </div>
                    <Table className="table" responsive striped>
                      <thead className="">
                        <tr>
                          <th scope="col">  Name</th>
                          <th scope="col">Mobile</th>
                          {/* <th scope="col">Email</th> */}
                          <th scope="col">location</th>
                          {/* <th scope="col">Contact phone</th> */}
                          <th scope="col"> Actions </th>
                        </tr>
                      </thead>
                      <tbody>
                        {stats?.length > 0 &&
                          stats?.map((item, i) => (
                            <tr key={i}>
                              <th scope="row" className="thd">
                                {/* <span className="slect3">
                                  <input
                                    type="checkbox"
                                    name="selectstaff"
                                    id=""
                                  />
                                </span>{" "} */}
                                <td>{item?.organization_name}</td>
                              </th>
                              {/* <td>{item?.contactPhoneNumber}</td> */}
                              {/* <td>
                                <span className="">
                                  {item?.contactEmailAddress}
                                </span>
                              </td> */}
                              <td>
                                <span className="">
                                  {item?.contactPhoneNumber}
                                </span>
                                <span className="notif1"></span>
                              </td>
                              <td>
                                <span className="">
                                  {item?.business_state +
                                    "," +
                                    item?.business_country}
                                </span>
                                <span className="notif1"></span>
                              </td>
                              <td>
                                <TableDropdownOrganisation
                                  company_info={item}
                                />
                              </td>
                            </tr>
                          ))}
                      </tbody>
                    </Table>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default AllOrganizations;
